        "Story": "As one of the powerful adversaries to fictional entities, genetic analysis by geneticists has long served as a final gambit against falsified fossils. However, it is clear to see that History Fictionologists have come up with a way to counter this. By taking genetic sequences as vessels for stories they wish to compose, they dedicate themselves with greater determination than any scholar and compile perfect molecular evolution trees, bringing the current species system into complete disarray. Bananas become amphibians and Wubbaboos were classified into birds. Unreliable data already illustrate that with more and more fossils becoming tainted with the scent of Enigmata, the influence of the History Fictionologist within biological fields is increasing exponentially.",
