        "Story": "The bodies of organic life are extremely fragile things. Extreme gravity, toxic air, deep ocean pressure â€” these things that are no more than daily realities for natives become trials of survival for any visitor. According to the Astral Express's data bank, a number of former technician Nameless worked together to create a clay doll that was capable of free transformation. They could simulate the physical form of native citizens and connect to the senses of their controller to allow the trailblazing journey to continue through even the harshest environments through long-distance operations. Due to their lack of realism, clay doll exploration was quickly abandoned by the Nameless, but this technology became a huge boom in the field of interstellar tourism, allowing the IPC to make massive profits.",
