        "Story": "A grotesque keychain that recorded, like a knotted-string device, its master's every brush against death. Following the murmurs of the Finality, the hunter galloped towards those dangerous futures time and time again. The supernova explosion in the Red Mandarin Star Zone, the Swarm invasion at Dormonton, the grand starship heist by the interstellar bandit Naro... He firmly believed that his destiny would not end here, and therefore enjoyed every second during which he brushed against death. In the end, he became a Creed Exequy, and the only thing he left in his wake was death.",
